  [],\n\t\"num_tags\": 0,\n\t\"name\": \"water-velocities-measured-using-adcp-in-the-eastern-long-island-sound-from-the-r-v-weicker-duri\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A 600 kHz RD Instruments ADCP was installed
  in the well of the R/V Weicker (Univ of Connecticut) and used to collect measurements
  of water velocity profiles along transects in Eastern Long Island Sound. There were
  three sampling periods, Summer 2009 (\"Sum09\" in filename prefixes), Spring 2010
  (\"Spr10\" in filename prefixes), and Summer 2010 (\"Sum10\" in filename prefixes).
  There were two types of transect, one lateral across the estuary (roughly north-south
  orientation, \"Lat\" in filename suffixes) and the other axial along the estuary
  (roughly east-west orientation, \"Axi\" in filename suffixes).\",\n\t\"owner_org\":
